window.bookSummaryJSON = "<p>Surviving, having survived, comes with a body count. </p> <p>Jonathon Hunter has evoked the wrath of 27th-century pirates. With his sexy twin bodyguards, Jonathon seeks to come to grips with station life in a suddenly hostile universe. </p> <p>Celebrity, gratitude, sudden attacks, and a mysterious prophecy are more than most 18-year-olds can handle. A reluctant hero, Jonathon is on a journey, seemingly out of his time, but always in time. </p> <p>Meet Jon Hunter as he starts a two-year journey to prophecy, with his AI sidekick and mostly female mercenary team. </p> <p>This is a rollicking coming-of-age story of life in space, fighter- and ground-combat action, and surviving the consequences of surviving.</p>"; 
